(11, 136, 'New feature: Workflows', 'new-feature-workflows', '<p>Workflows manage the stages your articles must go through until they are published.</p><p>The component to manage workflows is not enabled by default.</p><p>To see the workflow that we have provided with the sample data, you first need to enable this functionality.</p><ol><li>Access the administration area</li><li>From \'Content\' > \'Articles\' > \'Options\' > \'Integration\' tab set \'Enable workflow\' to \'Yes\'</li><li>Save changes</li></ol><p>Now when you access \'Content\' again you will see the section \'Workflows\'.</p><p>When you edit an article you will also see the new transitions for articles related to workflows.</p>', '', -2, 10, '2023-08-28 02:31:22', 739, 'Joomla', '2023-08-28 02:31:22', 739, NULL, NULL, '2023-08-28 02:31:22', NULL, '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_alt_empty\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"images\\/sampledata\\/cassiopeia\\/nasa4-400.jpg#joomlaImage:\\/\\/local-images\\/sampledata\\/cassiopeia\\/nasa4-400.jpg?width=400&height=400\",\"float_fulltext\":\"float-end\",\"image_fulltext_alt\":\"\",\"image_fulltext_alt_empty\":1,\"image_fulltext_caption\":\"www.nasa.gov\\/multimedia\\/imagegallery\"}', '{}', '{}', 1, 0, '', '', 1, 0, '{}', 0, '*', ''),
