(11, 'index.php?option=com_content&view=article&id=2', 'index.php?option=com_content&view=article&id=2:about&catid=10', 'About', ' This tells you a bit about this blog and the person who writes it. When you are logged in you will be able to edit this page by selecting the edit icon. ', '2023-08-28 02:31:22', 'c9ea0c06d037b40bb5bd6cf84bdd8db2', 1, 0, 1, '*', '2023-08-28 02:31:22', NULL, '2023-08-28 02:31:22', NULL, 0, 0, 3, ),
(12, 'index.php?option=com_content&view=article&id=3', 'index.php?option=com_content&view=article&id=3:working-on-your-site&catid=10', 'Working on Your Site', ' Here are some basic tips for working on your site. Joomla! has a \'front end\' that you are looking at now and an \'administrator\' or \'back end\' which is where you do the more advanced work of creating your site such as setting up the menus and deciding what modules to show. You need to login to the administrator separately using the same user name and password that you used to login to this part of the site. One of the first things you will probably want to do is change the site title and tag line and to add a logo. To do this select the Template Settings link in the menu which is visible if you log in. To change your site description, browser title, default email and other items, select Site Settings. More advanced configuration options are available in the administrator. To totally change the look of your site you will probably want to install a new template. Go to System, select Install - Extensions from the list and the extension installer will open. There are many free and commercial templates available for Joomla. As you have already seen, you can control who can see different parts of you site. When you work with modules and articles, setting the Access level to Registered will mean that only logged in users can see them. When you create a new article or other kind of content you also can save it as Published or Unpublished. If it is Unpublished site visitors will not be able to see it but you will. You can learn much more about working with Joomla from the Joomla documentation site and get help from other users at the Joomla forums. In the administrator there are help buttons on every page that provide detailed information about the functions on that page. ', '2023-08-28 02:31:22', 'eeb6feb1ada18f7c4d2186a64a6d2de7', 1, 0, 3, '*', '2023-08-28 02:31:22', NULL, '2023-08-28 02:31:22', NULL, 0, 0, 3, );
INSERT INTO `kwsr8_finder_links` (`link_id`, `url`, `route`, `title`, `description`, `indexdate`, `md5sum`, `published`, `state`, `access`, `language`, `publish_start_date`, `publish_end_date`, `start_date`, `end_date`, `list_price`, `sale_price`, `type_id`, `object`) VALUES
(13, 'index.php?option=com_content&view=article&id=4', 'index.php?option=com_content&view=article&id=4:welcome-to-your-blog&catid=9', 'Welcome to your blog', ' This is a sample blog posting. If you log in to the site (the Administrator Login link is on the very bottom of this page) you will be able to edit it and all of the other existing articles. You will also be able to create a new article and make other changes to the site. As you add and modify articles you will see how your site changes and also how you can customise it in various ways. Go ahead, you can\'t break it. ', '2023-08-28 02:31:22', '5b08dfd5ddf9b3244eaf9e42139ff44d', 1, 0, 1, '*', '2023-08-28 02:31:22', NULL, '2023-08-28 02:31:22', NULL, 0, 0, 3, ),
(14, 'index.php?option=com_content&view=article&id=5', 'index.php?option=com_content&view=article&id=5:about-your-home-page&catid=9', 'About your home page', ' Your home page is set to display the four most recent articles from the blog category in a column. Then there are links to the next two oldest articles. You can change those numbers by editing the content options settings in the blog tab in your site administrator. There is a link to your site administrator if you are logged in. If you want to have your blog post broken into two parts, an introduction and then a full length separate page, use the Read More span to insert a break. ', '2023-08-28 02:31:22', '3a959fe949f35f0378ab522a2d8ef26f', 1, 0, 1, '*', '2023-08-28 02:31:22', NULL, '2023-08-28 02:31:22', NULL, 0, 0, 3, ),
(15, 'index.php?option=com_content&view=article&id=6', 'index.php?option=com_content&view=article&id=6:your-modules&catid=9', 'Your Modules', ' Your site has some commonly used modules already preconfigured. These include: Image (type: Custom), which holds the image beneath the menu. This is a Custom module that you can edit to change the image. Popular Tags (type: Tags - Popular), which will appear if you use tagging on your articles. Enter a tag in the Tags field when editing. Older Posts (type: Articles - Category), which lists out articles by categories. Syndication (type: Syndication Feeds), which allows your readers to read your posts in a news reader. Login Form (type: Login), which allows your users to access restricted areas of the website. Each of these modules has many options which you can experiment with in the Module Manager in your site Administrator. When you are logged in you can also select the edit icon in the top right corner which will take you to an edit screen for that module. Always be sure to save and close any module you edit. Joomla! also includes many other modules you can incorporate in your site. As you develop your site you may want to add more modules that you can find at the Joomla Extensions Directory. ', '2023-08-28 02:31:22', 'c2252ec0a4ebf9c97de75b0a68717898', 1, 0, 1, '*', '2023-08-28 02:31:22', NULL, '2023-08-28 02:31:22', NULL, 0, 0, 3, );
INSERT INTO `kwsr8_finder_links` (`link_id`, `url`, `route`, `title`, `description`, `indexdate`, `md5sum`, `published`, `state`, `access`, `language`, `publish_start_date`, `publish_end_date`, `start_date`, `end_date`, `list_price`, `sale_price`, `type_id`, `object`) VALUES
(16, 'index.php?option=com_content&view=article&id=7', 'index.php?option=com_content&view=article&id=7:your-template&catid=9', 'Your Template', ' Templates control the look and feel of your website. This blog is installed with the Cassiopeia template. You can edit the options by selecting the Working on Your Site, Template Settings link in the menu which is visible when you log in. For example you can change the site background colour, highlights colour, site title, site description and title font used. More options are available in the site administrator. You may also install a new template using the extension manager. ', '2023-08-28 02:31:22', 'cb83384ffd62d9b1d43d9c058e4de4db', 1, 0, 1, '*', '2023-08-28 02:31:22', NULL, '2023-08-28 02:31:22', NULL, 0, 0, 3, ),
