(18, 'index.php?option=com_content&view=article&id=9', 'index.php?option=com_content&view=article&id=9:fit-for-woman&catid=11', 'FIT FOR WOMAN', ' We love get fitness to the moon and back! ', '2023-08-28 04:12:09', 'def1db0dcd14fe411ae9491e15bdcc97', 1, 1, 1, '*', '2023-08-28 02:31:22', NULL, '2023-08-28 02:31:22', NULL, 0, 0, 3, ),
