(52, 'index.php?option=com_content&view=article&id=35', 'index.php?option=com_content&view=article&id=35:join-us-today-ow&catid=2', 'JOIN US TODAY', ' Hello world ', '2023-08-28 08:50:52', '9b3d5ca8f50deedc7c5f1c952c77438d', 1, 1, 1, '*', '2023-08-28 08:50:52', NULL, '2023-08-28 08:50:52', NULL, 0, 0, 3, ),
