(11, 'com_content.article.2', '', '2023-08-28 02:31:22', 739, 665, '8936e6d1cdcfbca7b444c03bcb53a372109fa8ec', '{\"id\":2,\"asset_id\":127,\"title\":\"About\",\"alias\":\"about\",\"introtext\":\"<p>This tells you a bit about this blog and the person who writes it.<\\/p><p>When you are logged in you will be able to edit this page by selecting the edit icon.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":10,\"created\":\"2023-08-28 02:31:22\",\"created_by\":739,\"created_by_alias\":\"Joomla\",\"modified\":\"2023-08-28 02:31:22\",\"modified_by\":739,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2023-08-28 02:31:22\",\"publish_down\":null,\"images\":\"\",\"urls\":\"{}\",\"attribs\":\"{}\",\"version\":1,\"ordering\":0,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{}\",\"featured\":0,\"language\":\"*\",\"note\":null}', 0),
(12, 'com_content.article.3', '', '2023-08-28 02:31:22', 739, 2377, 'ad39d9617fdef2d634a5f7a8cd70e7aaacb6636a', '{\"id\":3,\"asset_id\":128,\"title\":\"Working on Your Site\",\"alias\":\"working-on-your-site\",\"introtext\":\"<p>Here are some basic tips for working on your site.<\\/p><ul><li>Joomla! has a \'front end\' that you are looking at now and an \'administrator\' or \'back end\' which is where you do the more advanced work of creating your site such as setting up the menus and deciding what modules to show. You need to login to the administrator separately using the same user name and password that you used to login to this part of the site.<\\/li><li>One of the first things you will probably want to do is change the site title and tag line and to add a logo. To do this select the Template Settings link in the menu which is visible if you log in. To change your site description, browser title, default email and other items, select Site Settings. More advanced configuration options are available in the administrator.<\\/li><li>To totally change the look of your site you will probably want to install a new template. Go to System, select Install - Extensions from the list and the extension installer will open. There are many free and commercial templates available for Joomla.<\\/li><li>As you have already seen, you can control who can see different parts of you site. When you work with modules and articles, setting the Access level to Registered will mean that only logged in users can see them.<\\/li><li>When you create a new article or other kind of content you also can save it as Published or Unpublished. If it is Unpublished site visitors will not be able to see it but you will.<\\/li><li>You can learn much more about working with Joomla from the <a href=\'https:\\/\\/docs.joomla.org\\/\'>Joomla documentation site<\\/a> and get help from other users at the <a href=\'https:\\/\\/forum.joomla.org\\/\'>Joomla forums<\\/a>. In the administrator there are help buttons on every page that provide detailed information about the functions on that page.<\\/li><\\/ul>\",\"fulltext\":\"\",\"state\":1,\"catid\":10,\"created\":\"2023-08-28 02:31:22\",\"created_by\":739,\"created_by_alias\":\"Joomla\",\"modified\":\"2023-08-28 02:31:22\",\"modified_by\":739,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2023-08-28 02:31:22\",\"publish_down\":null,\"images\":\"\",\"urls\":\"{}\",\"attribs\":\"{}\",\"version\":1,\"ordering\":0,\"metakey\":\"\",\"metadesc\":\"\",\"access\":3,\"hits\":0,\"metadata\":\"{}\",\"featured\":0,\"language\":\"*\",\"note\":null}', 0),
(13, 'com_content.article.4', '', '2023-08-28 02:31:22', 739, 1622, 'ea370552637e25e4c17ff306128654fab747a7db', '{\"id\":4,\"asset_id\":129,\"title\":\"Welcome to your blog\",\"alias\":\"welcome-to-your-blog\",\"introtext\":\"<p>This is a sample blog posting.<\\/p><p>If you log in to the site (the Administrator Login link is on the very bottom of this page) you will be able to edit it and all of the other existing articles. You will also be able to create a new article and make other changes to the site.<\\/p><p>As you add and modify articles you will see how your site changes and also how you can customise it in various ways.<\\/p><p>Go ahead, you can\'t break it.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":9,\"created\":\"2023-08-28 02:31:22\",\"created_by\":739,\"created_by_alias\":\"Joomla\",\"modified\":\"2023-08-28 02:31:22\",\"modified_by\":739,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2023-08-28 02:31:22\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa1-1200.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa1-1200.jpg?width=1200&height=400\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"Amazing Andromeda Galaxy\\\",\\\"image_intro_alt_empty\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa1-400.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa1-400.jpg?width=400&height=400\\\",\\\"float_fulltext\\\":\\\"float-start\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_alt_empty\\\":1,\\\"image_fulltext_caption\\\":\\\"www.nasa.gov\\\\\\/multimedia\\\\\\/imagegallery\\\"}\",\"urls\":\"{}\",\"attribs\":\"{}\",\"version\":1,\"ordering\":0,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{}\",\"featured\":1,\"language\":\"*\",\"note\":null}', 0),
(14, 'com_content.article.5', '', '2023-08-28 02:31:22', 739, 1808, '691c22f44e5ca07829b606eea829817dc3d74f53', '{\"id\":5,\"asset_id\":130,\"title\":\"About your home page\",\"alias\":\"about-your-home-page\",\"introtext\":\"<p>Your home page is set to display the four most recent articles from the blog category in a column. Then there are links to the next two oldest articles. You can change those numbers by editing the content options settings in the blog tab in your site administrator. There is a link to your site administrator if you are logged in.<\\/p><p>If you want to have your blog post broken into two parts, an introduction and then a full length separate page, use the Read More span to insert a break.<\\/p>\",\"fulltext\":\"<p>On the full page you will see both the introductory content and the rest of the article. You can change the settings to hide the introduction if you want.<\\/p>\",\"state\":1,\"catid\":9,\"created\":\"2023-08-28 02:31:22\",\"created_by\":739,\"created_by_alias\":\"Joomla\",\"modified\":\"2023-08-28 02:31:22\",\"modified_by\":739,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2023-08-28 02:31:22\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa2-1200.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa2-1200.jpg?width=1200&height=400\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_alt_empty\\\":1,\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa2-400.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa2-400.jpg?width=400&height=400\\\",\\\"float_fulltext\\\":\\\"float-start\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_alt_empty\\\":1,\\\"image_fulltext_caption\\\":\\\"www.nasa.gov\\\\\\/multimedia\\\\\\/imagegallery\\\"}\",\"urls\":\"{}\",\"attribs\":\"{}\",\"version\":1,\"ordering\":0,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{}\",\"featured\":1,\"language\":\"*\",\"note\":null}', 0),
(15, 'com_content.article.6', '', '2023-08-28 02:31:22', 739, 2380, 'c7adc5500155089d497c1f64663f28f66fb36db0', '{\"id\":6,\"asset_id\":131,\"title\":\"Your Modules\",\"alias\":\"your-modules\",\"introtext\":\"<p>Your site has some commonly used modules already preconfigured. These include:<\\/p><ul><li>Image (type: Custom), which holds the image beneath the menu. This is a Custom module that you can edit to change the image.<\\/li><li>Popular Tags (type: Tags - Popular), which will appear if you use tagging on your articles. Enter a tag in the Tags field when editing.<\\/li><li>Older Posts (type: Articles - Category), which lists out articles by categories.<\\/li><li>Syndication (type: Syndication Feeds), which allows your readers to read your posts in a news reader.<\\/li><li>Login Form (type: Login), which allows your users to access restricted areas of the website.<\\/li><\\/ul><p>Each of these modules has many options which you can experiment with in the Module Manager in your site Administrator. When you are logged in you can also select the edit icon in the top right corner which will take you to an edit screen for that module. Always be sure to save and close any module you edit.<\\/p><p>Joomla! also includes many other modules you can incorporate in your site. As you develop your site you may want to add more modules that you can find at the <a href=https:\\/\\/extensions.joomla.org\\/>Joomla Extensions Directory.<\\/a><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":9,\"created\":\"2023-08-28 02:31:22\",\"created_by\":739,\"created_by_alias\":\"Joomla\",\"modified\":\"2023-08-28 02:31:22\",\"modified_by\":739,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2023-08-28 02:31:22\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa3-1200.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa3-1200.jpg?width=1200&height=400\\\",\\\"float_intro\\\":\\\"\