(16, 'com_content.article.7', '', '2023-08-28 02:31:22', 739, 1650, '8331e0189138556530f426125e4622804339278a', '{\"id\":7,\"asset_id\":132,\"title\":\"Your Template\",\"alias\":\"your-template\",\"introtext\":\"<p>Templates control the look and feel of your website.<\\/p><p>This blog is installed with the Cassiopeia template.<\\/p><p>You can edit the options by selecting the Working on Your Site, Template Settings link in the menu which is visible when you log in.<\\/p><p>For example you can change the site background colour, highlights colour, site title, site description and title font used.<\\/p><p>More options are available in the site administrator. You may also install a new template using the extension manager.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":9,\"created\":\"2023-08-28 02:31:22\",\"created_by\":739,\"created_by_alias\":\"Joomla\",\"modified\":\"2023-08-28 02:31:22\",\"modified_by\":739,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2023-08-28 02:31:22\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa4-1200.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa4-1200.jpg?width=1200&height=400\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_alt_empty\\\":1,\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa4-400.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa4-400.jpg?width=400&height=400\\\",\\\"float_fulltext\\\":\\\"float-start\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_alt_empty\\\":1,\\\"image_fulltext_caption\\\":\\\"www.nasa.gov\\\\\\/multimedia\\\\\\/imagegallery\\\"}\",\"urls\":\"{}\",\"attribs\":\"{}\",\"version\":1,\"ordering\":0,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{}\",\"featured\":1,\"language\":\"*\",\"note\":null}', 0),
