(18, 'com_content.article.9', '', '2023-08-28 02:31:22', 739, 1448, 'f21623f425d81ce6d1ec2f21aef9d424559e0c15', '{\"id\":9,\"asset_id\":134,\"title\":\"Love\",\"alias\":\"love\",\"introtext\":\"<p><strong>We love Joomla to the moon and back!<\\/strong><\\/p><p>Thank you to all volunteers who have contributed!<\\/p>\",\"fulltext\":\"<p>Uurnip greens yarrow ricebean rutabaga endive cauliflower sea lettuce kohlrabi amaranth water spinach avocado daikon napa cabbage asparagus winter purslane kale. Celery potato scallion desert raisin horseradish spinach carrot soko. Lotus root water spinach fennel kombu maize bamboo shoot green bean swiss chard seakale pumpkin onion chickpea gram corn pea. Brussels sprout coriander water chestnut gourd swiss chard wakame kohlrabi beetroot carrot watercress. Corn amaranth salsify bunya nuts nori azuki bean chickweed potato bell pepper artichoke.<\\/p> \",\"state\":1,\"catid\":11,\"created\":\"2023-08-28 02:31:22\",\"created_by\":739,\"created_by_alias\":\"Joomla\",\"modified\":\"2023-08-28 02:31:22\",\"modified_by\":739,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2023-08-28 02:31:22\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa2-640.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa2-640.jpg?width=640&height=320\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_alt_empty\\\":1,\\\"image_intro_caption\\\":\\\"\\\"}\",\"urls\":\"{}\",\"attribs\":\"{}\",\"version\":1,\"ordering\":0,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{}\",\"featured\":0,\"language\":\"*\",\"note\":null}', 0),
(19, 'com_content.article.10', '', '2023-08-28 02:31:22', 739, 1287, 'd71c6bf2b71744f9de90ba9038d56f89bbad0726', '{\"id\":10,\"asset_id\":135,\"title\":\"Joomla\",\"alias\":\"joomla\",\"introtext\":\"<p><strong>We proudly present Joomla Version 4!<\\/strong><\\/p><p>Learn more about workflows in Joomla.<\\/p>\",\"fulltext\":\"<p>Cupcake ipsum dolor. Sit amet cotton candy ice cream sesame snaps cake marshmallow powder. Ice cream chocolate cake marshmallow halvah bonbon. Drag\\u00e9e carrot cake danish candy muffin brownie. Candy sugar plum ice cream chupa chups macaroon tiramisu souffl\\u00e9 oat cake. Topping cheesecake lollipop gummi bears icing sweet roll donut liquorice. Pie jelly-o candy donut oat cake cotton candy.<\\/p>\",\"state\":1,\"catid\":11,\"created\":\"2023-08-28 02:31:22\",\"created_by\":739,\"created_by_alias\":\"Joomla\",\"modified\":\"2023-08-28 02:31:22\",\"modified_by\":739,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2023-08-28 02:31:22\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa3-640.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa3-640.jpg?width=640&height=320\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_alt_empty\\\":1,\\\"image_intro_caption\\\":\\\"\\\"}\",\"urls\":\"{}\",\"attribs\":\"{}\",\"version\":1,\"ordering\":0,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{}\",\"featured\":0,\"language\":\"*\",\"note\":null}', 0),
(20, 'com_content.article.11', '', '2023-08-28 02:31:22', 739, 1633, '2744e5054332c5efaec29771e239d5d7a10c4887', '{\"id\":11,\"asset_id\":136,\"title\":\"New feature: Workflows\",\"alias\":\"new-feature-workflows\",\"introtext\":\"<p>Workflows manage the stages your articles must go through until they are published.<\\/p><p>The component to manage workflows is not enabled by default.<\\/p><p>To see the workflow that we have provided with the sample data, you first need to enable this functionality.<\\/p><ol><li>Access the administration area<\\/li><li>From \'Content\' > \'Articles\' > \'Options\' > \'Integration\' tab set \'Enable workflow\' to \'Yes\'<\\/li><li>Save changes<\\/li><\\/ol><p>Now when you access \'Content\' again you will see the section \'Workflows\'.<\\/p><p>When you edit an article you will also see the new transitions for articles related to workflows.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":10,\"created\":\"2023-08-28 02:31:22\",\"created_by\":739,\"created_by_alias\":\"Joomla\",\"modified\":\"2023-08-28 02:31:22\",\"modified_by\":739,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2023-08-28 02:31:22\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_alt_empty\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa4-400.jpg#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/sampledata\\\\\\/cassiopeia\\\\\\/nasa4-400.jpg?width=400&height=400\\\",\\\"float_fulltext\\\":\\\"float-end\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_alt_empty\\\":1,\\\"image_fulltext_caption\\\":\\\"www.nasa.gov\\\\\\/multimedia\\\\\\/imagegallery\\\"}\",\"urls\":\"{}\",\"attribs\":\"{}\",\"version\":1,\"ordering\":0,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{}\",\"featured\":0,\"language\":\"*\",\"note\":null}', 0),
